public void closeSelectRecord(Common _selectedRecord)
{
    if (canSelect)
    {
        element.getSelected();

        switch(parmEnum)
        {
            case HMAdvanceStaffLookupParm::Physician:
                if(element.args().parm() == 'Consultation')
                {
                    element.args().caller().storeConsultingPhysicianMultiSelect(conRecIds);
                }
                else
                {
                    element.args().caller().storePhysicianMultiSelect(conRecIds);
                }
                break;
            case HMAdvanceStaffLookupParm::Nurse:
                element.args().caller().storeNurseMultiSelect(conRecIds);
                break;
            case HMAdvanceStaffLookupParm::NursePhysician:
                break;
            case HMAdvanceStaffLookupParm::MultiNursePhysician:
                element.args().caller().storePhysicianMultiSelect(conRecIds);
                break;
            case HMAdvanceStaffLookupParm::PhysicianPractitionerNurse:
                element.args().caller().storePhysicianPractitionerNurseMultiSelect(conRecIds);
                break;
        }

       // element.args().caller().getPhysician(conRecIds);

        super(_selectedRecord);
    }
}

public void getSelected()
{
    HMClinicStaff   hmClinicStaffLocal;

    conRecIds = connull();

    hmClinicStaffLocal = HMClinicStaff_ds.getFirst(true);

    while(hmClinicStaffLocal)
    {
        conRecIds += hmClinicStaffLocal.RecId;

        hmClinicStaffLocal = HMClinicStaff_ds.getNext();
    }
}

public void init()
{
    parmEnum = element.args().parmEnum();

    super();

    canSelect = false;
   // element.selectMode(DirPerson_Name);
}

private void markSelected()
{
    int i, conLength;
    int64 recId;

    if (conRecIds != connull())
    {
        conLength = conlen(conRecIds);
        for (i = 1; i <= conLength; i++)
        {
            recId = conpeek(conRecIds,i);
            HMClinicStaff_ds.positionToRecordByValue(fieldnum(HMPatient, RecId), queryValue(recId));
            HMClinicStaff_ds.mark(true);
        }
    }
}

public void run()
{
    ContainerClass                  conClass;

    if (parmEnum == HMAdvanceStaffLookupParm::Nurse || parmEnum == HMAdvanceStaffLookupParm::Physician || parmEnum == HMAdvanceStaffLookupParm::ReferenceGroupPhysician)
    {
        HcmTitle_Type.visible(false);
    }
    else if (parmEnum == HMAdvanceStaffLookupParm::MultiNursePhysician || parmEnum == HMAdvanceStaffLookupParm::NursePhysician || parmEnum == HMAdvanceStaffLookupParm::PhysicianPractitionerNurse)
    {
        HcmTitle_Type.visible(true);
    }

    super();

    conClass = element.args().parmObject();
    conRecIds = conClass.value();
    this.markSelected();


}

public void selectRecord()
{
    canSelect = true;

    if (parmEnum == HMAdvanceStaffLookupParm::ReferenceGroupPhysician)
    {
        element.args().caller().storePhysician(HMClinicStaff.RecId);
    }
    else
    {
        element.closeSelect(DirPerson.Name);
    }

}

public void init()
{
    super();

    switch(parmEnum)
    {
        case HMAdvanceStaffLookupParm::Physician:
            this.query().dataSourceTable(tablenum(HMClinicStaffRole)).addRange( fieldNum(HMClinicStaffRole,Role)).value(SysQuery::value(HMStaffMemberType::Physician));
            break;
        case HMAdvanceStaffLookupParm::ReferenceGroupPhysician:
            this.query().dataSourceTable(tablenum(HMClinicStaffRole)).addRange( fieldNum(HMClinicStaffRole,Role)).value(SysQuery::value(HMStaffMemberType::Physician));
            break;
        case HMAdvanceStaffLookupParm::Nurse:
            this.query().dataSourceTable(tablenum(HMClinicStaffRole)).addRange( fieldNum(HMClinicStaffRole,Role)).value(SysQuery::value(HMStaffMemberType::Nurse));
            break;
        case HMAdvanceStaffLookupParm::NursePhysician:
            this.query().dataSourceTable(tablenum(HMClinicStaffRole)).addRange( fieldNum(HMClinicStaffRole,Role)).value(SysQuery::value(HMStaffMemberType::Physician));
            this.query().dataSourceTable(tablenum(HMClinicStaffRole)).addRange( fieldNum(HMClinicStaffRole,Role)).value(SysQuery::value(HMStaffMemberType::Nurse));
            break;
        case HMAdvanceStaffLookupParm::MultiNursePhysician:
            this.query().dataSourceTable(tablenum(HMClinicStaffRole)).addRange( fieldNum(HMClinicStaffRole,Role)).value(SysQuery::value(HMStaffMemberType::Physician));
            this.query().dataSourceTable(tablenum(HMClinicStaffRole)).addRange( fieldNum(HMClinicStaffRole,Role)).value(SysQuery::value(HMStaffMemberType::Nurse));
            this.query().dataSourceTable(tablenum(HMClinicStaffRole)).addRange( fieldNum(HMClinicStaffRole,Role)).value(SysQuery::value(HMStaffMemberType::NursePractitioner));
            break;
        case HMAdvanceStaffLookupParm::PhysicianPractitionerNurse:
            this.query().dataSourceTable(tablenum(HMClinicStaffRole)).addRange( fieldNum(HMClinicStaffRole,Role)).value(SysQuery::value(HMStaffMemberType::Physician));
            this.query().dataSourceTable(tablenum(HMClinicStaffRole)).addRange( fieldNum(HMClinicStaffRole,Role)).value(SysQuery::value(HMStaffMemberType::NursePractitioner));
            break;
    }
}

